const initState = {
  menuItemSibar: {},
};
export default function namingSibarReducer(state = initState, action) {
  switch (action.type) {
    case "NAMING_SIBAR":
      return {
        menuItemSibar: action.menuItemSibar,
      };
    default:
      return state;
  }
}
